request_body:
{"query":"query($branch: String!, $name: String!, $owner: String!, $after: String) {
  repository(name: $name, owner: $owner) {
    ref(qualifiedName: $branch) {
      target {
        __typename
        ... on Commit {
          history(first: 100, after: $after) {
            totalCount
            pageInfo {
              hasNextPage
              endCursor
            }
            nodes {
              oid
              parents(first: 1) {
                nodes {
                  oid
                }
              }
              committedDate
              messageHeadline
              associatedPullRequests(first: 1) {
                nodes {
                  number
                  title
                }
              }
            }
          }
        }
      }
    }
  }
}

","variables":{"branch":"master","name":"rust","owner":"rust-lang","after":null}}
